import React, {Component} from 'react'
import './App.css';
import peopleInfo from './component/peopleInfo'
import previous from './components/previous'


class App extends Component{
  constructor(){
    super()
    this.state= {
      info:peopleInfo,
      count: 0

    }
  }

  next(){
    this.setState({
      count:this.count + 1
    })
  }


  render() {
    return (
      <body>
        <div className='App'>
          <h1>{peopleInfo[0].name.lastName}, {peopleInfo[0].name.firstName} {peopleInfo[0].name.middleInital}</h1>
          <h2>Born in: {peopleInfo[0].bornIn}</h2>
          <h2>Lives in: {peopleInfo[0].liveIn}</h2>
          <h2>Contact Info :  </h2>
            <ul>
              <li>Phone#: {peopleInfo[0].contacts.phoneNumber}</li>
              <li>Email: {peopleInfo[0].contacts.email}</li>
            </ul>
          <h2>Born in: {peopleInfo[0].bornIn}</h2>

        </div>
      </body>
    )
  }
}

export default App;
